import logo from './logo.svg';
import './App.css';
import Home from "./Pages/Home"
import Login from "./Pages/Register"
import { BrowserRouter, Routes, Route } from "react-router-dom";
function App() {
  return (
      <BrowserRouter>
      <Routes>
          <Route path='/' element={<Home/>}/>
          <Route path="Login" element={<Login />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
